import React,{Component} from 'react'


class Listdisplay extends Component{
      render() {
        return  (
        <div>
            <table key = {this.props.element.id}>

                    <tr>
                    <td>
                        <h3>{this.props.element.display_name}</h3>
                    </td>
                    </tr>

            </table>
        </div>
      )
      }
}
export default Listdisplay;
